import React from 'react';
import './HomePage.css';

function HomePage({ setMode, handleReset }) {
  return (
    <div className="home-page">
      <h1>Complex CC</h1>
      <button onClick={() => setMode('free')}>Free-for-all</button>
      <button onClick={() => setMode('partners')}>Partners</button>
      <button className="reset" onClick={handleReset}>Reset Scores</button>
    </div>
  );
}

export default HomePage;
